import React from "react";
import Students from "./components/Students";

const data = [
    { Name:"Sanaya",Subject:"Maths", class:"2nd",School:"Oxford school"},
    {Name:"Aanaya",Subject:"Hindi", class:"3rd",School:"Blue Hills school"},
    {Name:"Inaya",Subject:"English", class:"4th",School:"Monum school"}
]
function SamrinApp() {
    return (
        <div>
            <Students data={data[2]}/>
        </div>
    )
}
export default SamrinApp
